import React from 'react';

const Quiz = () => {
    const question = [
        {
            question: 'What is the capital of France?',
            options: ['Berlin', 'Madrid', 'Par  is', 'Lisbon'],
        },
       
    ];

    return (
        <div>
          <h1>Online Quiz</h1>
          <QuestionComponent question={question} />
        </div>
      );
    };
    

export default Quiz;
